  false,\n\t\"url\": null,\n\t\"notes\": \"Twelve quadrats were sampled along 2 consecutively-placed,
  25m transect lines, as part of Rapid Ecological Assessments, conducted at 9 sites
  at Maug in the Marianas Archipelago from 25 May - 09 June 2007, aboard the NOAA
  ship Hi'ialakai, during the Reef Assessment and Monitoring Program (RAMP) Cruise
  HI0703. Raw survey data included genus presence and relative abundance, and voucher
  specimens. Detailed taxonomic analyses of voucher specimens are presented.\",\n\t\"license_title\":
